import React, { Component } from 'react';
import { Container } from 'react-bootstrap';
export class Dashboard extends Component {
    render(){
        return (
            <Container fluid>
                <Row>
                    <Col md={6} className={align-self-center}>
                        <h3>Overview</h3>
                    </Col>
                </Row>
            </Container>
        );
    }
}
